  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Tewaukon
  WMD outlines Refuge accomplishments during the 1986 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning,
  compliance with environmental and cultural resource mandates, and research and investigations.
  Refuge administration is outlined; information about personnel, youth programs,
  manpower programs, volunteer programs, funding, and safety is given. Habitat management
  is also covered; subjects include wetlands, forests, croplands, grasslands, grazing,
  haying, fire management, pest control, and WPA easements. The wildlife section of
  the report discusses endangered and threatened species, waterfowl, marsh birds and
  waterbirds, shorebirds, raptors, game mammals, and wildlife propagation. The public
  uses of the Refuge described in this report include interpretive programs, hunting,
  trapping, and law enforcement. The equipment and facilities section of the report
  provides information about new construction, rehabilitation, and equipment replacement.
  Cooperative programs and items of interest are provided at the end.\",\n\t\"owner_org\":
